import React from 'react';

class Task extends React.Component {
    render(){
        const task  = this.props;

        return <div>
            {task.title} - 
            {task.descripcion} - 
            {task.done} - 
            {task.id}
            <input type="checkbox"></input>
            <button>x</button>
        </div>
    }
}

export default Task;
